import Header from './fronPage/Head';
import './App.css';
import {BrowserRouter as Router,Route,Routes} from "react-router-dom";
import Navbar from './fronPage/navbar/Navbar';
import Footer from "./fronPage/footer/Footer"
import Login from "./User/Login"
import Home from './Home/home';

function App() {
  return (
    <>
    <Router>
      <Navbar>
      <Routes>
    <Route exact path="/" element={ <Header/>}/>
    <Route exact path="/login" element={<Login/>} /> 
    </Routes>
    </Navbar>
    <Routes>
    <Route exact path="/enter" element={<Home/>} />
    </Routes>

    <Footer/>
    </Router>
    </>
  );
}

export default App;
